import "../App.css";
import Standard from "./Standard";
const customStyle = {};
function Navbar() {
	return (
		<div className="Nav">
			<Standard name="8th" style={customStyle}>
				8th
			</Standard>
			<Standard name="9th" style={customStyle}></Standard>
			<Standard name="10th" style={customStyle}></Standard>
			<Standard name="11th" style={customStyle}></Standard>
			<Standard name="12th" style={customStyle}></Standard>
		</div>
	);
}
export default Navbar;
